import React from 'react';

function About() {
    return (
        <section className="container">
            <h2 className="row">About Me</h2>
            <img className="col-md img-fluid rounded-circle w-25" src={require('../../assets/images/headshot.jpg')} alt='Headshot'/>
            <p className="col-md">
                Example bio paragraph about me
            </p>
        </section>
    )
}

export default About;
